import React, {useState} from 'react'



export default function TextForm(props) {

    const handleUpClick =()=>{
        /* eslint-disable */console.log(...oo_oo(`845fe5e8_0`,'Upper case was clicked '));
        setText("You have clicked on handleUpclicking");

    }
    const handleOnChange =()=>{
        /* eslint-disable */console.log(...oo_oo(`845fe5e8_1`,'On chqanged '));

    }

    const[text,setText] =useState('Enter text here...');

    return (
        <div>

            <h2>{props.heading}</h2>            
            <div className="mb-3">

                <textarea className="form-control" value={text} onChange={handleOnChange} id="myBox" rows="8"></textarea>

                <button className="btn btn-warning" onClick={handleUpClick}>Convert to Uppercase</button>
            </div>

        </div>
